 We can use React Context to create a scope context for the Tooltip component.

## Create a Tooltip component

First, we create a Tooltip component that will be used in different places. The Tooltip component will have a button that will open the Tooltip and a div that will contain the Tooltip content.
```
import { useState } from 'react';

export default function Tooltip({ children }) {
  const [isOpen, setIsOpen] = useState(false);

  return (
    <div>
      <button onClick={() => setIsOpen(!isOpen)}>Open Tooltip</button>
      {isOpen && <div>{children}</div>}
    </div>
  );
}
```
## Create a TooltipContext

Next, we create a TooltipContext that will be used to close the previously opened Tooltip and so on. The TooltipContext will have a function that will be used to close the previously opened Tooltip.
```
import { createContext } from 'react';

export const TooltipContext = createContext({
  closeTooltip: () => {},
});
```
## Create a TooltipProvider

Next, we create a TooltipProvider that will be used to provide the TooltipContext to the Tooltip component. The TooltipProvider will have a function that will be used to close the previously opened Tooltip.
```
import { useState } from 'react';
import { TooltipContext } from './TooltipContext';

export function TooltipProvider({ children }) {
  const [isOpen, setIsOpen] = useState(false);

  const closeTooltip = () => {
    setIsOpen(false);
  };

  return (
    <TooltipContext.Provider value={{ closeTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
}
```
## Use the TooltipProvider

Next, we use the TooltipProvider to provide the TooltipContext to the Tooltip component. The TooltipProvider will have a function that will be used to close the previously opened Tooltip.
```
import { TooltipProvider } from './TooltipProvider';
import Tooltip from './Tooltip';

export default function App() {
  return (
    <TooltipProvider>
      <Tooltip>
        <p>This is a tooltip</p>
      </Tooltip>
    </TooltipProvider>
  );
}
```
## Use the TooltipContext

Next, we use the TooltipContext to close the previously opened Tooltip and so on. The TooltipContext will have a function that will be used to close the previously opened Tooltip.
```
import { useContext } from 'react';
import { TooltipContext } from './TooltipContext';

export default function Tooltip({ children }) {
  const { closeTooltip } = useContext(TooltipContext);

  return (
    <div>
      <button onClick={closeTooltip}>Close Tooltip</button>
      {children}
    </div>
  );
}
```
